import React from "react";  // Keep this at the top of your file
import { Link, useNavigate } from "react-router-dom";

// First Navbar using inline styles
export default function Navbar() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Navigate to the live Logout page which clears storage and redirects
    navigate("/logout");
  };

  return (
    <nav
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px 30px",
        background: "linear-gradient(90deg, #667eea, #764ba2)",
        color: "#fff",
        boxShadow: "0 4px 6px rgba(0,0,0,0.1)",
        position: "sticky",
        top: 0,
        zIndex: 1000,
      }}
    >
      {/* Logo */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          cursor: "pointer",
        }}
        onClick={() => navigate("/dashboard")}
      >
        <img
          src="/logo192.png" // Replace with your custom logo path
          alt="CryptoLogo"
          style={{ width: "40px", height: "40px", marginRight: "10px" }}
        />
        <h2 style={{ margin: 0, fontSize: "20px", fontWeight: "bold" }}>
          CryptoPort
        </h2>
      </div>

      {/* Navigation Links */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          gap: "20px",
          fontSize: "16px",
        }}
      >
        <Link
          to="/dashboard"
          style={{ color: "#fff", textDecoration: "none", transition: "0.2s" }}
        >
          Dashboard
        </Link>
        <Link
          to="/wallets"
          style={{ color: "#fff", textDecoration: "none", transition: "0.2s" }}
        >
          Wallet
        </Link>
        <Link
          to="/register"
          style={{ color: "#fff", textDecoration: "none", transition: "0.2s" }}
        >
          Register
        </Link>
        <Link
          to="/login"
          style={{ color: "#fff", textDecoration: "none", transition: "0.2s" }}
        >
          Login
        </Link>

        <button
          onClick={handleLogout}
          style={{
            padding: "5px 12px",
            backgroundColor: "#ff4d4d",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
            color: "#fff",
            fontWeight: "bold",
          }}
        >
          Logout
        </button>
      </div>
    </nav>
  );
}

// Second Navbar using Tailwind CSS


const NavbarWithTailwind = () => {
  const navigate = useNavigate();

  return (
    <nav className="bg-gradient-to-r from-blue-600 to-purple-600 text-white py-4 px-6 flex justify-between items-center shadow-md sticky top-0 z-10">
      {/* Logo */}
      <div className="flex items-center cursor-pointer" onClick={() => navigate("/dashboard")}>
        <img
          src="/logo192.png" // Replace with your custom logo path
          alt="CryptoLogo"
          className="w-10 h-10 mr-2"
        />
        <h2 className="text-xl font-bold">CryptoPort</h2>
      </div>

      {/* Navigation Links */}
      <div className="flex gap-6">
        <Link
          to="/dashboard"
          className="text-white text-lg hover:text-gray-200 transition duration-300"
        >
          Dashboard
        </Link>
        <Link
          to="/wallets"
          className="text-white text-lg hover:text-gray-200 transition duration-300"
        >
          Wallet
        </Link>
        <Link
          to="/register"
          className="text-white text-lg hover:text-gray-200 transition duration-300"
        >
          Register
        </Link>
        <Link
          to="/login"
          className="text-white text-lg hover:text-gray-200 transition duration-300"
        >
          Login
        </Link>

        {/* Logout Button */}
        <button
          onClick={() => navigate("/logout")}
          className="bg-red-500 px-4 py-2 rounded-lg text-white font-bold hover:bg-red-600 transition"
        >
          Logout
        </button>
      </div>
    </nav>
  );
};

export { NavbarWithTailwind };
